package operators;

public class LogicalOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int x = 145;
		
		if (x >= 1 && x < 100) {
			System.out.println("The Number is less then 100");
		}
		else {
			System.out.println("The Number is Greater then 100");
		}
	}

}
